import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import HomePage from './HomePage';
import NameInputPage from './NameInputPage'
import EmailInputPage from './EmailInputPage';
import InterviewPage from './InterviewPage'; // Import other pages if necessary

function App() {
  return (
    <Router>
      <Route>
        <Route path="/" exact component={HomePage} />
        <Route path="/name-input" exact component={NameInputPage} />
        <Route path="/interview" component={InterviewPage} />
        <Route path="/email-input" render={(props) => <EmailInputPage {...props} score={85} />} />
      </Route>
    </Router>
  );
}

export default App;
